import 'bootstrap/dist/css/bootstrap.min.css';




function App() {
  return (
<>
<BrowserRouter>
<Navbares/>
  <Router>
    <Route path="/home" to={<Home/>}/>
    <Route path="/home" to={<Home/>}/>
  </Router>
  <Footerres/>
